      int num = candidates[index];
      sub.push_back(num);
      backtack(candidates, index + 1, ret, sub, target - num);
      sub.pop_back();

      // Avoid duplicate situations.
      while (index + 1 < candidates.size() && candidates[index] == candidates[index + 1])
      {
	index ++;
      }
    }
  }

